import React from 'react';

const SearchResults = ({ searchResults }) => {
  return (
    <div>
      <h2>Search Results:</h2>
      <ul>
        {searchResults.map((result, index) => (
          <li key={index}>{result}</li>
        ))}
      </ul>
    </div>
  );
};

export default SearchResults;
